import React from 'react';
import './dashleftpane.css'

class DashLeftPane extends React.Component
{

	renderIcon()
	{
		return(
			<div>
			<img src="home-24px.png" alt="home"/>
			</div>
		);

	}

	render()
	{
		return(
			<div className="dashleftpane">
				{this.renderIcon()}
				{this.renderIcon()}
				{this.renderIcon()}
			</div>
		);
	}

}

export default DashLeftPane;
